import React, { Component } from "react";
import { NavLink } from "react-router-dom";
class Product extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    const { key, image, name, price } = this.props.product;
    return (
      <NavLink
        exact
        to={`/details/${this.props.product.key}`}
        className="product-container-Link"
      >
        <div className="product-container">
          <img src={"/" + this.props.product.image} />
          <div className="product-descripiton">
            <h6>{this.props.product.name}</h6>
            <h6 className="price">{this.props.product.price}</h6>
          </div>
        </div>
      </NavLink>
    );
  }
}

export default Product;
